webpackJsonp([0xff6e15c3ddd7],{1324:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2013-01-14-mountain-biking-oahu/index.md absPath of file >>> MarkdownRemark",html:'<p>Friday I managed to get some mountain biking in. Years ago I read about mountain biking in Hawaii and how awesome it was. It is awesome, but I don\'t remember reading about getting an ass kicking in the article. Oahu is beautiful and the mountain biking was a fun challenge, but tree roots and mud make up a lot of the trail. If you venture into the rain forest here be ready for plenty of both. I tried the <a href="http://www.mtbhawaii.com/trails/west_kaunala_trail">West Kaunala Trail</a>. I\'m not a hard core mountain biker so I found this ride a fun challenge with plenty of hike a bike sections over tree roots and through some nasty mud. A more skilled rider could probably ride more. I\'d love to watch someone with skills climb the sections with nasty roots.</p>\n<p>Some pictures:</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 14821" title="" src="/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-b80fa.jpg" srcset="/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-cf410.jpg 163w,\n/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-62f2a.jpg 325w,\n/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-b80fa.jpg 650w,\n/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-08cb4.jpg 975w,\n/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-f2bf9.jpg 1300w,\n/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-fd4ba.jpg 1950w,\n/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>There\'s a very idyllic ranch on the way up.</p>\n<p>The jeep road is wide and makes for an easy/fun ride</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1506" title="" src="/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-b80fa.jpg" srcset="/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-cf410.jpg 163w,\n/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-62f2a.jpg 325w,\n/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-b80fa.jpg 650w,\n/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-08cb4.jpg 975w,\n/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-f2bf9.jpg 1300w,\n/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-fd4ba.jpg 1950w,\n/static/IMG_1506-489bd1ab1f13d3c63f63187d79fd1dc2-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>I think I rode the route opposite of what was recommended. Here\'s where I started.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1508-785834577b09d0d152fad1d265becc85-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1508" title="" src="/static/IMG_1508-785834577b09d0d152fad1d265becc85-b80fa.jpg" srcset="/static/IMG_1508-785834577b09d0d152fad1d265becc85-cf410.jpg 163w,\n/static/IMG_1508-785834577b09d0d152fad1d265becc85-62f2a.jpg 325w,\n/static/IMG_1508-785834577b09d0d152fad1d265becc85-b80fa.jpg 650w,\n/static/IMG_1508-785834577b09d0d152fad1d265becc85-08cb4.jpg 975w,\n/static/IMG_1508-785834577b09d0d152fad1d265becc85-f2bf9.jpg 1300w,\n/static/IMG_1508-785834577b09d0d152fad1d265becc85-fd4ba.jpg 1950w,\n/static/IMG_1508-785834577b09d0d152fad1d265becc85-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Plenty of muck and mud to plow through.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1514" title="" src="/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-b80fa.jpg" srcset="/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-cf410.jpg 163w,\n/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-62f2a.jpg 325w,\n/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-b80fa.jpg 650w,\n/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-08cb4.jpg 975w,\n/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-f2bf9.jpg 1300w,\n/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-fd4ba.jpg 1950w,\n/static/IMG_1514-8ebdb1eaf121859dc91da19d3e09123e-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>More mud. It was a theme.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1525" title="" src="/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-b80fa.jpg" srcset="/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-cf410.jpg 163w,\n/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-62f2a.jpg 325w,\n/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-b80fa.jpg 650w,\n/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-08cb4.jpg 975w,\n/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-f2bf9.jpg 1300w,\n/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-fd4ba.jpg 1950w,\n/static/IMG_1525-d707daa22a0a8fcc2491680bfb8823d8-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>This was cool. Nice of the trees to not block the trail.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1517-cb268d171163fa46581e25eb29e50976-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1517" title="" src="/static/IMG_1517-cb268d171163fa46581e25eb29e50976-b80fa.jpg" srcset="/static/IMG_1517-cb268d171163fa46581e25eb29e50976-cf410.jpg 163w,\n/static/IMG_1517-cb268d171163fa46581e25eb29e50976-62f2a.jpg 325w,\n/static/IMG_1517-cb268d171163fa46581e25eb29e50976-b80fa.jpg 650w,\n/static/IMG_1517-cb268d171163fa46581e25eb29e50976-08cb4.jpg 975w,\n/static/IMG_1517-cb268d171163fa46581e25eb29e50976-f2bf9.jpg 1300w,\n/static/IMG_1517-cb268d171163fa46581e25eb29e50976-fd4ba.jpg 1950w,\n/static/IMG_1517-cb268d171163fa46581e25eb29e50976-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>There are 4 creek crossings.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1522" title="" src="/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-b80fa.jpg" srcset="/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-cf410.jpg 163w,\n/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-62f2a.jpg 325w,\n/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-b80fa.jpg 650w,\n/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-08cb4.jpg 975w,\n/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-f2bf9.jpg 1300w,\n/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-fd4ba.jpg 1950w,\n/static/IMG_1522-c65fdbab915a91aa479da4403cfa1142-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>This is where the killer trees on Lord of the Rings came from.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1528" title="" src="/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-b80fa.jpg" srcset="/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-cf410.jpg 163w,\n/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-62f2a.jpg 325w,\n/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-b80fa.jpg 650w,\n/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-08cb4.jpg 975w,\n/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-f2bf9.jpg 1300w,\n/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-fd4ba.jpg 1950w,\n/static/IMG_1528-59926db25af76f74cfe42964b0f5e244-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>The view is the reward for the climb. That\'s the North Shore of Oahu.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1496" title="" src="/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-b80fa.jpg" srcset="/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-cf410.jpg 163w,\n/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-62f2a.jpg 325w,\n/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-b80fa.jpg 650w,\n/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-08cb4.jpg 975w,\n/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-f2bf9.jpg 1300w,\n/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-fd4ba.jpg 1950w,\n/static/IMG_1496-8109545104e57d5df7558be7bcbe0638-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>After mountain biking I managed to get in a bit of a road ride back to Turtle Bay to meet everyone else. The roads on Oahu aren\'t my favorite places to ride. There\'s a constant stream of traffic and I moved off the road a couple of times. The saving grace was the fruit stands along the side of the road. The nice old lady who sold me pineapple and papaya laughed pretty hard when I tried to stuff everything into my tiny Camelback. I nearly dropped the pineapple so I ended up carrying all the groceries on the handlebars - XTR/Sram 29er turned into grocery hauler.</p>\n<p>We ended the night helping Judy make it home from Haleiwa Joes:</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1577" title="" src="/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-b80fa.jpg" srcset="/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-cf410.jpg 163w,\n/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-62f2a.jpg 325w,\n/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-b80fa.jpg 650w,\n/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-08cb4.jpg 975w,\n/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-f2bf9.jpg 1300w,\n/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-fd4ba.jpg 1950w,\n/static/IMG_1577-b05f03f6eaf7ce266b758b55f210fdb2-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Actually we ended the night this way:</p>\n<p>The only thing scarier than a mouse is a cockroach.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1582" title="" src="/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-b80fa.jpg" srcset="/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-cf410.jpg 163w,\n/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-62f2a.jpg 325w,\n/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-b80fa.jpg 650w,\n/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-08cb4.jpg 975w,\n/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-f2bf9.jpg 1300w,\n/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-fd4ba.jpg 1950w,\n/static/IMG_1582-cd7a0306dc2e5efc611fecae07257ccb-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    ',frontmatter:{title:"Mountain Biking Oahu",date:"January 14, 2013",imageUrl:null,image:{childImageSharp:{sizes:{src:"/static/IMG_14821-dc7e6341b0bea5bfc3fdbca14bf4b1c9-381d6.jpg"}}}}}},pathContext:{path:"/mountain-biking-oahu"}}}});
//# sourceMappingURL=path---mountain-biking-oahu-ebe4378a7da2f2b149b3.js.map